import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import UserSidebar from "./UserSidebar";
import { useParams } from "react-router-dom";
import axios from "axios";

const baseUrl = 'http://127.0.0.1:8000/api/elearning'


function CourseQuizLst() {
    const [quizData,setQuizData]=useState([]);
  const studentId= localStorage.getItem('studentId')
  

  useEffect(() => {
    try {
      axios.get(baseUrl + "/fetch-enrolled-courses/"+studentId).then((res) => {
        setcourseData(res.data);
      });
    } catch (error) {
      console.log(error);
    }
  }, []);

  return (
    <div className="container mt-4">
      <div className="row">
        <aside className="col-md-3"><UserSidebar /></aside>
        <section className="col-md-9">
            <div className="card">
                <h5 className="card-header">Quiz List</h5>
                <div className="card-body">
                    <table className="table table-bordered">
                        <thead>
                            <tr>
                                <th>Quiz</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Python Quiz</td>
                                <td className="text-success">Attempted</td>
                            </tr>
                            <tr>
                                <td>Django Quiz</td>
                                <td><Link className="btn btn-sm btn-warning" to={`/take-quiz/1`}>Take Quiz</Link></td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        </section>
      </div>
    </div>
  );
}
export default CourseQuizLst;
